import React, {useState} from 'react';
import '../scss/Output.scss';



export default function Output({color}) {

    const [rectColor, setRectColor] = useState('gray');
    const [rectWidth, setRectWidth] = useState('100px');

    return (
        <div class='output-rect' style={{backgroundColor: rectColor}, {width: rectWidth}}
        onClick={() => setRectColor(color)}>
            output
        </div>
    )
}
